import React from "react";
import styles from "./Dialogs.module.css"
import DialogItem from "./DialogItem/DialogItem";
import Message from "./Message/Messages";



const Dialogs = (proms) => {


    const dialogData = [
        {id: 1, name: "Alex"},
        {id: 2, name: "Petya"},
        {id: 3, name: "Olga"},
        {id: 4, name: "Vanya"},
        {id: 5, name: "Petya"},
        {id: 6, name: "Tanya"}
    ]

    const messagesData = [
        {id: 1, message: "Hello"},
        {id: 2, message: "No"},
        {id: 3, message: "Yes"},
        {id: 4, message: "Hello"},
        {id: 5, message: "No"},
        {id: 6, message: "Yes"}
    ]

    const dialogElements = dialogData.map(d => <DialogItem name={d.name} id={d.id}/> );

    const messagesElements = messagesData.map(m => <Message message={m.message}/>)

    return (
        <div className={styles.dialogs}>
            <div className={styles.dialogsItem}>
                {dialogElements}
            </div>
            <div className={styles.messages}>
                {messagesElements}
            </div>
        </div>
    )
}

export default Dialogs;
